import axios from "axios";

const BASE_URL = 'https://626fed34c508beec488c55b4.mockapi.io';

export const getContacts = async () => {
    const response = await fetch(`${BASE_URL}/contacts`);
    const data = await response.json();
    return data;
}

getContacts();
